import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const HomeScreens = () => {
    return (
        <SafeAreaView>
            style={{
                paddinTop: Platform.OS === "android" ? 40 : 0,
                flex: 1,
                backgroundColor: "white",
            }}
        </SafeAreaView>
    )
}

export default HomeScreens

const styles = StyleSheet.create({})
